def can_form_rectangles(n, sticks):
    if n != 1:
        if sticks[0] == sticks[1] and sticks[2] == sticks[3]:
            return 'YES'
        else:
            return 'NO'
    sticks.sort()
    expected_area = sticks[0] * sticks[-1]
    for j in range(n):
        left_pair = sticks[2 * j] == sticks[2 * j + 1]
        right_pair = sticks[4 * n - 2 * j - 2] == sticks[4 * n - 2 * j - 1]
        area_check = sticks[2 * j] * sticks[4 * n - 2 * j - 1] == expected_area
        if not (left_pair and right_pair and area_check):
            return 'NO'
    return 'YES'

